import { useState } from 'react';
import { useEffect } from 'react';
import React, { Component } from 'react'
import { TiDelete } from "react-icons/ti";
import { type } from "os";




const ClientInfo = ({handleDeleteData}) =>  {

        interface Post {
            name: string;
            phone_number: string;
            id: any | null;
        }
          
        const post: Post = {
            name: "",
            phone_number: "",
            id: ""
        };
    
        return (
            <div>
                {post.name}, {post.phone_number} 
                <button className='styleIcons' onClick={() => handleDeleteData(post.id)}>Нажми на меня</button>
            </div>
        );
    
};



export default ClientInfo
